    return(
        <div>
            <nav>
                <ul>
                    <li><a>Home</a></li>
                    <li><a>About</a></li>
                    <li><a>Skills</a></li>
                    <li><a>Projects</a></li>
                    <li><a>Contacts</a></li>
                </ul>
            </nav>
        </div>
    );
}

